le_timeout);\n\nwindow._bt_autoscale_timeout = setTimeout(function () {\n    /**\n     * @variable cb_obj `fig_ohlc.x_range`.\n     * @variable source `ColumnDataSource`\n     * @variable ohlc_range `fig_ohlc.y_range`.\n     * @variable volume_range `fig_volume.y_range`.\n     */\n    \"use strict\";\n\n    let i = Math.max(Math.floor(cb_obj.start), 0),\n        j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"1143063","type":"CustomJS"},{"attributes":{"source":{"id":"1142744"}},"id":"1142987","type":"CDSView"},{"attributes":{"axis_label":"Equity","coordinates":null,"formatter":{"id":"1142799"},"group":null,"major_label_policy":{"id":"1142810"},"minor_tick_line_color":null,"ticker":{"id":"1142765"}},"id":"1142764","type":"LinearAxis"},{"attributes":{"axis":{"id":"1142910"},"coordinates":null,"dimension":1,"group":null,"ticker":null},"id":"1142913","type":"Grid"},{"attributes":{"data":{"Close":{"__ndarray__":"rkfhehQeXEAzMzMzM8NcQNejcD0Kl1xAj8L1KFx/XECamZmZmclbQI/C9Shc/1tACtejcD1aXEBmZmZmZtZbQPYoXI/ChVtA4XoUrkeRWkDsUbgehVtbQNejcD0KF1tAw/UoXI8yW0BxPQrXo4BbQMP1KFyPwltAZmZmZmZ2W0DsUbgehbtaQKRwPQrXo1pAw/UoXI/SWkAzMzMzM7NaQFyPwvUojFpAhetRuB6lWkBmZmZmZnZbQD0K16NwPVtAcT0K16NAW0AfhetRuJ5bQD0K16Nw3VtAexSuR+EKXEBI4XoUrmdcQD0K16Nw3VxAhetRuB5FXUDXo3A9CiddQMP1KFyPqmBAmpmZmZnZYECamZmZmSlhQLgehetR6GBAUrgehesJYUDD9Shcj9JgQKRwPQrXO2FA16NwPQpPYUBSuB6F63FhQDMzMzMzc2FA7FG4HoU7YUCPwvUoXMdhQClcj8L1wGFAzczMzMzcYUCuR+F6FF5hQHsUrkfhYmFAH4XrUbh2YUDD9Shcj5JhQIXrUbgebWFAAAAAAABQYUB7FK5H4eJgQLgehetRSGBAuB6F61EAYED2KFyPwhVgQOF6FK5HsV9AXI/C9Si8X0CuR+F6FG5fQBSuR+F6dF9A9ihcj8IlX0AAAAAAAGBfQHsUrkf
